import { useState } from "react";
import { useDispatch } from "react-redux";
import { Flogin } from "../Action/LoginuserAction";
import style from "../Page/Login.module.css";
import clsx from "clsx";
import { LOG_IN_REQUEST } from "../Constant/Constant";
import * as React from "react";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";

function Login() {
  const dispatch = useDispatch();

  const [taikhoan, Settaikhoan] = useState("");
  const [matkhau, Setmatkhau] = useState("");

  const handle = () => {
    // const action=Flogin(loginset)]
    dispatch({
      type: LOG_IN_REQUEST,
      payload: { email: taikhoan, password: matkhau },
    });
  };
  return (
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1, width: "25ch" },
      }}
      noValidate
      autoComplete="off"
    >
      <div className={clsx(style.login)}>
        <div className={clsx(style.login1)}>
          <h3 className={clsx(style.td)}>tai khoan</h3>
          {/* <TextField
            id="filled-password-input"
            label="Account"
            type="text"
            autoComplete="current-password"
            variant="filled"
            value={taikhoan}
            onChange={(e) => Settaikhoan(e.target.value)}
          /> */}
          <input
          type="text"
          value={taikhoan}
          onChange={(e) => Settaikhoan(e.target.value)}
          className={clsx(style.inp)}
        /> 
          <br />
           <h3 className={clsx(style.td)}>mat khau</h3> 

          <input
          type="password"
          value={matkhau}
          onChange={(e) => Setmatkhau(e.target.value)}
          className={clsx(style.inp)}
        />
          <br />

          <button  onClick={handle}>
            dang nhap
          </button>
        </div>
      </div>
    </Box>
  );
}

export default Login;
